import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import "./StockDetails.css";
import { Tab, Tabs, Box } from "@mui/material";
// import TabPanel from '@mui/lab/TabPanel';
import { TabContext, TabPanel, TabList } from "@mui/lab";

function StockDetailsComponent() {
  const { id } = useParams();
  const [tickerData, setTickerData] = useState(null);
  const [iexData, setIexData] = useState(null);
  const [newsData, setNewsData] = useState(null);
  const [value, setValue] = useState("1");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  useEffect(() => {
    // Perform API call here and set the data
    // http://localhost:8080/ticker/NVDA
    // fetch(`http://localhost:8080/ticker/${id}`)
    //   .then((response) => response.json())
    //   .then((data) => {
    //     setTickerData(data);
    //     console.log("Data: ");
    //     console.log(data);
    //   });
    // fetch(`http://localhost:8080/iex/${id}`)
    // .then((response) => response.json())
    // .then((data) => {
    //   setIexData(data);
    //   console.log("IEX Data: ");
    //   console.log(data);
    // });
    // fetch(`http://localhost:8080/news/${id}`)
    // .then((response) => response.json())
    // .then((data) => {
    //   setNewsData(data);
    //   console.log("News: ");
    //   console.log(data);
    // });
  }, [id]);

  return (
    <div>
      {/* {tickerData && ( */}
      <div className="container resultPage">
        <div className="row">
          <div className="col leftCol">
            <div className="container companyData">
              <div className="row">
                <div className="col">
                  <h1>
                    ticker
                    {/* {tickerData['ticker']} */}
                  </h1>
                </div>
                <div className="col">
                  <h5>
                    {/* {id} */}
                    fav_btn
                  </h5>
                </div>
              </div>

              <div className="row">
                <h3>
                  name
                  {/* {tickerData['name']} */}
                </h3>
              </div>

              <div className="row">
                <h5>
                  exchangecode
                  {/* {tickerData['exchangeCode']} */}
                </h5>
              </div>
            </div>
          </div>

          <div className="col rightCol">
            <div className="container stockValues">
              <div className="row justify-content-end">
                <h1>
                  {/* {id} */}
                  Stock Value
                </h1>
              </div>
              <div className="row justify-content-end">
                <h3>
                  {/* {id} */}
                  Stock Points
                </h3>
              </div>
              <div className="row justify-content-end">
                <h6>
                  {/* {id} */}
                  get current time
                </h6>
              </div>
            </div>
          </div>
        </div>

        {/* Tabs */}
        <Box sx={{ width: "100%", typography: "body1", marginTop:"20px"}}>
          <TabContext value={value}>
            <Box sx={{ borderBottom: 1, borderColor: "divider", display:"flex", justifyContent: 'center'}}>
              <TabList
                onChange={handleChange}
                // aria-label="lab API tabs example"
                sx={{ justifyContent: 'space-evenly', width: '100%' }}
              >
                <Tab label="Summary" value="1" sx={{ flex: 1 }}/>
                <Tab label="Top News" value="2" sx={{ flex: 1 }}/>
                <Tab label="Charts" value="3" sx={{ flex: 1 }}/>
              </TabList>
            </Box>
            <TabPanel value="1">Data Structures</TabPanel>
            <TabPanel value="2">Algorithms</TabPanel>
            <TabPanel value="3">Web Development</TabPanel>
          </TabContext>
        </Box>
      </div>
      {/* )} */}
    </div>
  );
}

export default StockDetailsComponent;
